import React from 'react';
import '../App.css';
const Firstsec = ()=>{
    return(
        <div class="row">
  <div class="column">
    <img src="img_snow.jpg" alt="Snow" style="width:100%" />
  </div>
  <div class="column">
    <img src="img_forest.jpg" alt="Forest" style="width:100%"/>
  </div>
  <div class="column">
    <img src="img_mountains.jpg" alt="Mountains" style="width:100%"/>
  </div>
</div>
    );
}

export default Firstsec;
